import { useRoutes } from "react-router-dom";

import Header from "./components/Header/Header";
import NotFound from "./components/NotFound"
import Home from "./pages/home/home";

function App() {

  const routes = useRoutes([
    { path: "/", element: <Home /> },
    { path: "*", element: <NotFound /> },
  ]);

  return (
    <div>
        {/* <Header /> */}
        { routes}
    </div>
  );
}

export default App;
